const RoleReducer = (state = "", action) => {
  switch (action.type) {
    case "ADMIN":
      return "ADMIN";
    case "SUPER_ADMIN":
      return "SUPER_ADMIN";
    default:
      return state;
  }
};
export default RoleReducer;
